import React from "react";

import { ReactComponent as House } from "../../assets/icons/buy-a-house.svg";

import * as S from "./card.styled";

const Card = () => (
  <S.Container>
    <S.HeadSection>
      <S.Icon>
        <House />
      </S.Icon>
      <S.HeadTextSection>
        <h2>Buy a house</h2>
        <h3>Saving goal</h3>
      </S.HeadTextSection>
    </S.HeadSection>
  </S.Container>
);

export default Card;
